The Complete Photographer[Team Nanban]

 Tom Ang | 2010 | 400 Pages | ISBN: 0756664292 | PDF | 105 MB

DESCRIPTION:

Taking the successful thematic approach of How to Photograph Absolutely Everything and combining it with the practical tools and genre tutorials of Digital Photography Masterclass, 
The Complete Photographer encourages photographers to explore every discipline and experiment with different approaches, to hone their skills, and find their own personal style. 
Unlike other books, which tend to cover the principles of photography in a general way, The Complete Photographer is based around tutorials on ten different genres-Portraits, 
Landscape and Nature, Fashion, Wildlife, Sport, Documentary, Events, Travel, Architecture, and Fine Art-and shows in step-by-step detail how an idea progresses from concept stage to final image.


